import React from 'react';
import './App.css';
import {Grid} from "@material-ui/core"
import youtube from "./api/youtube"

function App() {
  return (
    <Grid justify="center" container spacing={16}>
      <Grid item xs={12}>
        <Grid container spacing={16}>
          <Grid item xs={12}>
            Search bar
          </Grid>
          <Grid item xs={8}>
            Video Details
          </Grid>
          <Grid item xs={4}>
            Video List
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}

export default App;
